// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract Auction {
    struct Bid {
        address bidder;
        uint256 amount;
    }

    address public owner;
    uint256 public highestBid;
    address public highestBidder;
    uint256 public endTime;
    bool public auctionEnded;
    Bid[] public bids;

    // Eventos
    event NewBid(address indexed bidder, uint256 amount);
    event AuctionEnded(address winner, uint256 amount);

    // Modificadores
    modifier onlyOwner() {
        require(msg.sender == owner, "No autorizado: solo el propietario puede ejecutar esta funcion.");
        _;
    }

    modifier auctionActive() {
        require(block.timestamp < endTime, "La subasta ha terminado.");
        _;
    }

    modifier auctionEndedOnly() {
        require(auctionEnded, "La subasta no ha terminado.");
        _;
    }

    // Constructor
    constructor(uint256 duration) {
        owner = msg.sender;
        highestBid = 10 gwei; // Valor inicial de la subasta
        endTime = block.timestamp + duration;
    }

    // Función para ofertar
    function bid() external payable auctionActive {
        require(msg.value > highestBid * 105 / 100, "La oferta debe ser al menos un 5% mayor que la oferta mas alta actual.");

        // Devolver el depósito de la oferta anterior
        if (highestBidder != address(0)) {
            payable(highestBidder).transfer(highestBid); // Devolver la oferta anterior
        }

        highestBid = msg.value;
        highestBidder = msg.sender;
        bids.push(Bid(msg.sender, msg.value));
        
        // Extender el tiempo de la subasta si está en los últimos 10 minutos
        if (endTime - block.timestamp <= 10 minutes) {
            endTime += 10 minutes;
        }

        emit NewBid(msg.sender, msg.value);
    }

    // Mostrar ganador
    function showWinner() external view auctionEndedOnly returns (address winner, uint256 amount) {
        return (highestBidder, highestBid);
    }

    // Mostrar ofertas
    function getBids() external view returns (Bid[] memory) {
        return bids;
    }

    // Finalizar la subasta
    function endAuction() external onlyOwner auctionActive {
        auctionEnded = true;
        emit AuctionEnded(highestBidder, highestBid);
    }

    // Retirar depósitos
    function withdraw() external auctionEndedOnly {
        uint256 amountToWithdraw = 0;

        for (uint256 i = 0; i < bids.length; i++) {
            if (bids[i].bidder == msg.sender && bids[i].bidder != highestBidder) {
                amountToWithdraw += bids[i].amount * 98 / 100; // Devolver menos la comisión
            }
        }

        require(amountToWithdraw > 0, "No hay fondos para retirar.");
        payable(msg.sender).transfer(amountToWithdraw);
    }

    // Reembolso parcial
    function withdrawPartial(uint256 amount) external auctionActive {
        require(amount <= address(this).balance - highestBid, "No se puede retirar esta cantidad.");
        require(amount > 0, "La cantidad debe ser mayor que cero.");

        uint256 lastBid = 0;

        for (uint256 i = 0; i < bids.length; i++) {
            if (bids[i].bidder == msg.sender) {
                lastBid = bids[i].amount;
            }
        }

        require(amount <= lastBid, "No puedes retirar mas de tu ultima oferta.");

        payable(msg.sender).transfer(amount);
    }
}

